function searchResultsHandling(data) {
  function singleTemplate(data) {
      return `
          <div class="search-item" >
            ${data}
          </div>
      `;
    }
    function template(data) {
      return `
          ${data.join('')}
      `;
    }
    const renderData = [];
    
    data.forEach(section => {
      section.items.forEach(article => {
        renderData.push(renderTemplates[section.type]({...article, type: section.type}))
      })
    });
    console.log(renderData.length);

    if (renderData.length === 0) {
      $('[data-result-container]').html(emptyResultsTemplate);
      return;
    }
    $('[data-pagination-container]').pagination({
      dataSource: renderData,
      pageSize: 6,
      callback: function(data, pagination) {
          // template method of yourself
          var html = template(data);
          $('[data-result-container]').html(html);
      }
    })
}

